import Modal from "react-bootstrap/Modal";

const ConfirmationCode = (props) => {
  return (
    <Modal
      show={props.show}
      onHide={props.handleClose}
      backdrop="static"
      keyboard={false}
    ></Modal>
  );
};

export default ConfirmationCode;
